        cudaHostAlloc(&ptr, n*(*ld)*elemsize, cudaHostRegisterPortable);
    else
        ptr = aligned_alloc(64, n*(*ld)*elemsize);
#else
    ptr = aligned_alloc(64, n*(*ld)*elemsize);
#endif
    return ptr;
}

