	//e->event_fase = (void *) EFLY_REQUEST_FASE_INIT;
	fly_event_state_set(e, __e, EFLY_REQUEST_STATE_INIT);
	fly_event_fase_set(e, __e, EFLY_REQUEST_FASE_INIT);
