double binomial(int n, int k) {
	if(n==0&&k==0) return 1;
	else if(k<0) return 0;
	else if(n<0) return 1;
	else if(n==0&&k!=0) return 0;

  double numerator;
  double denominator;
  int i;
  if(k>n) return 0;
  if(k > n/2) k = n-k;
  numerator = 1.0;
  denominator = 1.0;
  for(i = n-k+1; i <= n; i++) numerator *= (double)i;
  for(i = 2; i <= k; i++) denominator *= (double)i;
  return numerator/denominator;
}

