static void heap_push(heap *h, void *e) {
    if (h->size >= h->capacity) {
        h->capacity *= 2;
        h->data = (void **) realloc(h->data, (h->capacity) * sizeof(void *));
    }
    int i = h->size;
    h->data[h->size++] = e;
    if (i == 0)
        return;

    void **data = h->data;
    for (int parent; i > 0; i = parent) {
        parent = (i - 1) / 2;
        void *p = data[parent];
        if (h->compare(p, e) <= 0)
            break;
        data[i] = p;
    }
    data[i] = e;
