    ADC_setSampleHold();

    // Set resolution to 10 bits. (see user guide 25.3.3)
    ADC_setPrecision(precision);

    // enable interrupt
    ADC_enableInterrupts();

    // Select analog input channel.
    ADC_setInputChannel(channel);

    // Enable ADC conversions
    ADC_enableConversion();
}

