static void func_die (void *vo)
{
    struct instance *o = vo;
    ASSERT(!o->dying)

    // if we're finished, die immediately
    if (o->state == STATE_FINISHED) {
        instance_free(o);
        return;
    }

    // set dying
    o->dying = 1;

    // start terminating if not already
    if (o->state == STATE_INIT) {
        start_terminating(o);
    }
}

