	if ( ptr == NULL )
	{
		//printf( "SISGEV!!!, PACKET: %s\n", packet );
		return SENDING_ERROR;
	}

	strcpy( g_market->chunks[ new_item_idx ].description, ptr );

	// copy cost to struct
	ptr = strtok( NULL, "|" );
	if ( ptr == NULL )
	{
		//printf( "SISGEV!!!, PACKET: %s\n", packet );
		return SENDING_ERROR;
