void MidLine(int x1, int y1, int x2, int y2)
{
	//交换两点的坐标
	if ((x1 - x2) > 0 && (y1 - y2) > 0)
	{
		int c = x1;
		x1 = x2;
		x2 = c;
		c = y1;
		y1 = y2;
		y2 = c;
	}
	if ((x1 - x2) < 0 && (y1 - y2) > 0)
	{
		int c = x1;
		x1 = x2;
		x2 = c;
		c = y1;
		y1 = y2;
		y2 = c;
	}
	float a = y1 - y2, b = x2 - x1;
	float m = -(a / b); //斜率，用于判断直线不同的情况

	//当斜率大于0，小于1的情况
	if (0 <= m && m <= 1)
	{
		float d = 2 * a + b, deta1 = 2 * a, deta2 = 2 * (a + b), x = x1, y = y1;
		while (x < x2)
		{
			SetPixel(x, y); //画坐标点
			if (d < 0)
			{
				x++, y++, d += deta2;
			}
			else
			{
				x++, d += deta1;
			}
		}
	}
	//当斜率大于1的情况
	if (m > 1)
	{
		int d = a + 2 * b, deta1 = 2 * b, deta2 = 2 * (a + b), x = x1, y = y1;
		while (y < y2)
		{
			SetPixel(x, y); //画坐标点
			if (d > 0)
			{
				y++, x++, d += deta2;
			}
			else
			{
				y++, d += deta1;
			}
		}
	}
	//当斜率小于-1的情况
	if (m <= -1)
	{
		int d = -a + 2 * b, deta1 = 2 * b, deta2 = 2 * (b - a), x = x1, y = y1;
		while (y < y2)
		{
			SetPixel(x, y); //画坐标点
			if (d < 0)
			{
				x--, y++, d += deta2;
			}
			else
			{
				y++, d += deta1;
			}
		}
	}
	//当斜率小于0大于-1的情况
	if (m > -1 && m < 0)
	{
		int a = y1 - y2, b = x2 - x1;
		int d = -2 * a + b, deta1 = -2 * a, deta2 = 2 * (b - a), x = x1, y = y1;
		while (x > x2)
		{
			SetPixel(x, y); //画坐标点
			if (d > 0)
			{
				x--, y++, d += deta2;
			}
			else
			{
				x--, d += deta1;
			}
		}
	}
}

