RK_S32 PPContinuousCheck(RK_U32 value)
{

    RK_S32 ret = (RK_S32) PP_OK;
    RK_U32 first = 0;
    RK_U32 tmp = 0;

    if(value)
    {
        do
        {
            tmp = value & 1;
            if(tmp)
                ret = (RK_S32) PP_OK;
            else
                ret = (RK_S32) PP_PARAM_ERROR;

            first |= tmp;

            value = value >> 1;
            if(!tmp && !tmp && first)
                break;

        }
        while(value);
    }

    return ret;
}

