int file_size(FILE *f, size_t *size) {
    long off = ftell(f);
    if (off == -1) return -1;
    if (fseek(f, 0, SEEK_END) == -1) return -1;
    long len = ftell(f);
    if (len == -1) return -1;
    if (fseek(f, off, SEEK_SET) == -1) return -1;
    *size = (size_t) len;
    return 0;
}

