static void biquad_init_band(struct iir_filter *filter, double fs,
    double f1, double f2, int stop)
{
    double ts = 1.0 / fs;
    double bw, f;
    double w;
    complex_d p, q;
    complex_d z, s;
    double phi;
    complex_d _z, p_lp, p_bp;
    double k, x, y;
    double wa1, wa2, wa;
    double *a = filter->a;
    double *b = filter->b;
    int n, i;

    f = sqrt(f1 * f2);
    w = 2 * M_PI * f / fs;

    /* Map to continuous-time frequencies (pre-warp) */

    wa1 = 2 * fs * tan(M_PI * f1 * ts);
    wa2 = 2 * fs * tan(M_PI * f2 * ts);

    bw = wa2 - wa1;
    wa = sqrt(wa1 * wa2);

    n = filter->sections;

    for (i = 0; i < n; i += 1) {
        phi = M_PI / 2 + M_PI * (2 * i + 1) / (n * 2);
        x = cos(phi);
        y = sin(phi);

        p_lp.re = x * bw / (wa * 2);
        p_lp.im = y * bw / (wa * 2);

        /*
         *  Map every low-pass pole to a complex conjugate
         *  pair of band-bass poles
         */

        s = p_lp;
        complex_square(&s);
        s.re = 1 - s.re;
        s.im = 0 - s.im;
        complex_sqrt(&s);
        x = p_lp.re - s.im;
        y = p_lp.im + s.re;
        p_bp.re = x * wa;
        p_bp.im = y * wa;

        /*
         *  Convert every pair from continuous (s)
         *  to discrete (z) using bilinear transform
         */

        bilinear_transform(&z, &p_bp, ts);

        x = z.re;
        y = z.im;

        /*
         *  Find denominator coefficients from
         *  the complex conjugate pair of poles
         */

        a[0] = 1;
        a[1] = -2 * x;
        a[2] = x * x + y * y;

        if (stop) {
            /* Band-stop: zeros at ω and ~ω */
            s.re = 0;
            s.im = wa;
            bilinear_transform(&z, &s, ts);
            x = z.re;
            y = z.im;

            b[0] = 1;
            b[1] = -2 * x;
            b[2] = x * x + y * y;
        } else {
            /* Band-pass: zeros at ±1 */
            b[0] = 1;
            b[1] = 0;
            b[2] = -1;
        }

        /* Scale the parameters to get unity gain in the bassband */

        if (stop) {
            /* Band-stop: unity gain at zero frequency */
            _z.re = 1;
            _z.im = 0;
        } else {
            /* Band-pass: unity gain at ω */
            _z.re = cos(w);
            _z.im = -sin(w);
        }

        p.re = b[2];
        p.im = 0;
        complex_mul(&p, &_z);
        p.re += b[1];
        complex_mul(&p, &_z);
        p.re += b[0];

        q.re = a[2];
        q.im = 0;
        complex_mul(&q, &_z);
        q.re += a[1];
        complex_mul(&q, &_z);
        q.re += 1;

        complex_div(&p, &q);

        x = p.re;
        y = p.im;
        k = 1.0 / sqrt(x * x + y * y);

        b[0] *= k;
        b[1] *= k;
        b[2] *= k;

        a += filter->sect_ord + 1;
        b += filter->sect_ord + 1;
    }

    for (i = 0; i < (n + 1) * 2; i += 1)
        filter->d[i] = 0;
}

